import { ReactComponent as Mail } from '../../../assets/icons/mail.svg';
import { ReactComponent as GitHub } from '../../../assets/icons/github.svg';
import { ReactComponent as LinkedIn } from '../../../assets/icons/linkedin2.svg';

function ContactMe() {
    return (
        <div className="contact-me-container">
            <h3>Contact me!</h3>
            <div className="footer-links">
                <a className="footerA" href="https://github.com/Andrav90"><GitHub className="footer-icon" />GitHub</a>
                <a className="footerA" href="mailto:ada.vraciu@gmail.com"><Mail className="footer-icon" />ada.vraciu@gmail.com</a>
                <a className="footerA" href="https://www.linkedin.com/in/andra-v-0b9427165/"><LinkedIn className="footer-icon" />LinkedIn</a>
            </div>
            <div className="footer-c">
                &copy; Andra Vraciu, 2020
            </div>
        </div>
    );
};

export default ContactMe;
